  return (
    <div className="todo-list">
      <h2>Todo List</h2>
      <input placeholder="What need to be done?"></input>
      <button>OK</button>

      {todolist.map((todo) => (
        <div className="todo-list">
          <p>{todo.title}</p>
        </div>
      ))}
    </div>
  );
};

export default Todo;
